        "fct-descr": "\u003cp\u003eAdditive a encapsulates the notion of a commutative group, specified\nby the following laws:\n\u003c/p\u003e\u003cpre\u003e\n          a + b === b + a\n    (a + b) + c === a + (b + c)\n       zero + a === a\n   a + negate a === 0\n\u003c/pre\u003e\u003cp\u003eTypical examples include integers, dollars, and vectors.\n\u003c/p\u003e\u003cp\u003eMinimal definition: \u003ccode\u003e\u003ca\u003e+\u003c/a\u003e\u003c/code\u003e, \u003ccode\u003e\u003ca\u003ezero\u003c/a\u003e\u003c/code\u003e, and (\u003ccode\u003e\u003ca\u003enegate\u003c/a\u003e\u003c/code\u003e or '(-)')\n\u003c/p\u003e",
        "fct-module": "Algebra.Additive",
