        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThere are several types of numbers\nwhere a subset of numbers can be considered as set of scalars.\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e A '(Complex.T Double)' value can be converted to \u003ccode\u003e\u003ca\u003eDouble\u003c/a\u003e\u003c/code\u003e if the imaginary part is zero.\n\u003c/li\u003e\u003cli\u003e A value with physical units can be converted to a scalar if there is no unit. \n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eOf course this can be cascaded,\ne.g. a complex number with physical units can be converted to a scalar\nif there is both no imaginary part and no unit.\n\u003c/p\u003e\u003cp\u003eThis is somewhat similar to the multi-type classes NormedMax.C and friends.\n\u003c/p\u003e\u003cp\u003eI hesitate to define an instance for lists\nto avoid the mess known of MatLab.\nBut if you have an application where you think\nyou need this instance definitely\nI'll think about that, again.\n\u003c/p\u003e\u003c/div\u003e",
