        "fct-descr": "\u003cp\u003eThis class allows lossless conversion\nfrom any representation of a rational to the fixed \u003ccode\u003e\u003ca\u003eRational\u003c/a\u003e\u003c/code\u003e type.\n\"Lossless\" means - don't do any rounding.\nFor rounding see \u003ca\u003eAlgebra.RealRing\u003c/a\u003e.\nWith the instances for \u003ccode\u003e\u003ca\u003eFloat\u003c/a\u003e\u003c/code\u003e and \u003ccode\u003e\u003ca\u003eDouble\u003c/a\u003e\u003c/code\u003e\nwe acknowledge that these types actually represent rationals\nrather than (approximated) real numbers.\nHowever, this contradicts to the \u003ccode\u003e\u003ca\u003eTranscendental\u003c/a\u003e\u003c/code\u003e class.\n\u003c/p\u003e\u003cp\u003eLaws that must be satisfied by instances:\n\u003c/p\u003e\u003cpre\u003e  fromRational' . toRational === id\n\u003c/pre\u003e",
