        "fct-descr": "\u003cp\u003eList.inits is defined by\n\u003ccode\u003einits = foldr (x ys -\u003e [] : map (x:) ys) [[]]\u003c/code\u003e\n\u003c/p\u003e\u003cp\u003eThis is too strict for our application.\n\u003c/p\u003e\u003cpre\u003e Prelude\u003e List.inits (0:1:2:undefined)\n [[],[0],[0,1]*** Exception: Prelude.undefined\n\u003c/pre\u003e\u003cp\u003eThe following routine is more lazy than \u003ccode\u003e\u003ca\u003einits\u003c/a\u003e\u003c/code\u003e\nand even lazier than \u003ccode\u003e\u003ca\u003einits\u003c/a\u003e\u003c/code\u003e from \u003ccode\u003eutility-ht\u003c/code\u003e package,\nbut it is restricted to infinite lists.\nThis degree of laziness is needed for \u003ccode\u003esqrtFP\u003c/code\u003e.\n\u003c/p\u003e\u003cpre\u003e Prelude\u003e lazyInits (0:1:2:undefined)\n [[],[0],[0,1],[0,1,2],[0,1,2,*** Exception: Prelude.undefined\n\u003c/pre\u003e",
